// Returns configuration for a node
export function fromJson(jsonCode) {
    let nodeObject = JSON.parse(jsonCode);
    return fromJson(nodeObject);
}

function fromObject(nodeObject) {
    let inputsObjects = [];
    for (var input in nodeObject.inputs)
        inputsObjects.push({
            name: input.name,
            type: input.type
        });

    return {
        id: nodeObject.id,
        position: { x: nodeObject.positionX, y: nodeObject.positionY },
        type: 'usual',
        data: {
            title: nodeObject.name,
            inputs: inputsObjects,
            type: nodeObject.output.type,
        }
    }
}

export default function manyFromJson(jsonCode) {
    let nodeObjects = JSON.parse(jsonCode);
    let nodeObjectsParsed = [];
    for (var index in nodeObjects) {
        console.log(nodeObjects[index]);
        nodeObjectsParsed.push(fromObject(nodeObjects[index]));
    }
    return nodeObjectsParsed;
}
